import React from "react";
import "./../styles/Algorithms.css";

const Algorithms = ({ matrix }) => {
    const runAlgorithm = (algorithm) => {
        console.log(`Запуск алгоритму: ${algorithm}`);
        // Тут можна реалізувати алгоритм
    };

    return (
        <section id="algorithms-section">
            <h2>Алгоритми</h2>
            <button onClick={() => runAlgorithm("Максимальний потік")}>
                Максимальний потік
            </button>
            <button onClick={() => runAlgorithm("Мінімальний переріз")}>
                Мінімальний переріз
            </button>
        </section>
    );
};

export default Algorithms;
